Dans le Département Informatique, pôle Digital & Innovation, vos missions seront les suivantes :
Participation à la conception de futures solutions en collaboration avec les développeurs et experts techniques ;
Gestion des travaux de prototypage (POC) des futures fonctionnalités et solutions ;
Gestion des projets d’intégration pour des clients externes ;
Communication autour des produits et des services : gestion des sites internet, formation des utilisateurs, vulgarisation, démonstrations aux prospects, idéation interne…
Participer au développement des services digitaux de GTT ;
Participer à la création de notre future plateforme de Smart Shipping ;
Conduite des projets de convergence technique et fonctionnelle avec partenaires ;
Animation fonctionnelle transverse des experts sollicités : Modélisation, Process Instrumentation, Mouvements Liquides, IT Développement ;
Définition des critères d’acceptation, tester et obtenir la validation des experts et utilisateurs ;
Promotion et animation d’une démarche « UX » ;
Animation et suivi des prestataires externes ; rédaction de cahier des charges, suivi des appels d’offres, réception des livrables ;
Reporting sur son périmètre ;
Contribution à la définition de la feuille de route des produites et des services ;
Contribution à la création de synergies entre les équipes françaises et étrangères de GTT.

PROFIL :

Formation : Ingénieur Grande École généraliste ou spécialisé en informatique avec au moins trois années d’expérience dans un poste similaire.
Compétences demandées (savoir-faire, savoir-être):
Expérience Chef de Projets dans un environnement agile BtoB ou BtoC ;
Esprit d’innovation et d’entreprenariat ;
Curiosité scientifique, technique, analyse et esprit critique ;
Première expérience en développement exigée (environnement MS / C# .NET) ;
Expérience dans l’animation transverse d’une communauté d’utilisateurs et d’experts métier ;
Aisance en communication orale et écrite ;
Anglais technique (lu, écrit, parlé) indispensable ;
Autonomie ;
Capacité de synthèse et pédagogie, notamment pour adapter le contenu des sujets techniques face à des interlocuteurs aux profils variés ;
Initiative et réactivité.

Pour postuler, envoyer votre curriculum Vitae à Marie AW (maw@gtt.fr)
GTT – 1 Route de Versailles 78470 SAINT REMY LES CHEVREUSE

PayPlug est la Fintech qui démocratise le e-commerce. Nos clients sont des milliers de TPE/PME qui cherchent avant tout une solution simple, performante et qui les protège contre la fraude.

Fondée en 2012, PayPlug s’est rapidement imposée comme une référence sur le marché. Après avoir obtenu un agrément auprès de la Banque de France, nous avons rejoint le groupe Natixis / BPCE en 2017 et avons l’ambition de devenir une Fintech majeure en Europe.

Dans un secteur qui nécessite autant d’innovation que de sérieux, nous valorisons :
Le mode solution, qui permet de surmonter les obstacles et relever des challenges ;
Le professionnalisme, indispensable dans un secteur où les attentes sont très élevées ;
L’humilité, une qualité essentielle d’un “Team Player” qui cherche à s’améliorer.

Nous serions ravis de vous rencontrer si vous cherchez à apprendre au quotidien dans un environnement exigeant, être responsabilisé rapidement sur des projets stimulants, et travailler avec une équipe de passionnés et solidaire.
Poste et missions
NOTRE AMBITION
Nous construisons notre plateforme à partir des meilleures technologies open source disponibles, en faisant le choix le plus adapté pour chaque projet. Nous sommes convaincus des bénéfices d’une architecture SOA de type RESTful et nous évoluons dans un environnement micro-service.

Aujourd’hui notre stack contient notamment Python, Flask, PostgreSQL, ElasticSearch, RabbitMQ, Salt, AWS pour la partie back-end et React pour la partie front-end. Nous travaillons selon une méthodologie agile (inspirée de SCRUM et Lean Startup) avec des livraisons propres, testées et régulières.

VOTRE MISSION
Nos ambitions et nos projets :
Construire la meilleure API de paiement du marché ;
Partager vos expériences et vos connaissances avec les autres développeurs ;
Accompagner les développeurs moins expérimentés sur les projets ;
Participer à l'évolution de notre stack d'Infrastructure as Code ;
Améliorer la disponibilité, la sécurité de nos services et de nos outils de livraison de code ;
Contribuer à l'évolution de notre plateforme (ajout de nouveaux modes de paiement, nouvelles fonctionnalités produit, etc.)
Profil et compétences requises
Développeur expérimenté (4 ans minimum), vous maîtrisez Python ou bien avez une bonne maîtrise d’un langage OO (PHP, Ruby, Java, C++, C# ...) ;
Vous avez une expérience en développement frontend sur un framework Javascript ou vous avez envie de monter en compétence sur React ;
Les problématiques "ops" vous intéressent ;
Vous avez la conviction que le code doit être bien testé et que les tests unitaires font partie intégrante d’une fonctionnalité livrable ;
Vous aimez travailler en équipe ;
Vous êtes fier du travail que vous produisez ;
Vous êtes passionné par la technologie et avez une compréhension approfondie du fonctionnement du Web ;
Vous cultivez votre curiosité sur les langages et les frameworks récents.

