Ingénieur d’études et développement C# – (H/F)

Société informatique spécialisée depuis plus de 40 ans dans les services informatiques à destination des métiers de la propriété intellectuelle, nous proposons des prestations de développements logiciels, de gestion de domaines, d’hébergement sécurisé et d’exploitation informatique. Nos actionnaires sont des acteurs majeurs dans le monde de la propriété intellectuelle. Aujourd’hui, nous cherchons à renforcer notre département d’édition de logiciels en recrutant un ingénieur d’études et développement C# sénior.

Missions

Dans le cadre de nos projets clients et sous la direction du CTO, vous travaillerez sur l’ensemble des phases du projet.

Vos missions seront les suivantes :
Participer à l’analyse fonctionnelle des besoins des utilisateurs afin de valider la faisabilité technologique;

Elaborer et rédiger les spécifications techniques à partir de spécifications fonctionnelles et des exigences techniques;

Développer, tester et intégrer des composants logiciels;

Déployer la solution auprès des utilisateurs;

Assurer un reporting aussi bien auprès de votre CTO que des clients;

Assurer une veille technologique afin de proposer des solutions prenant en compte les innovations en matière de développement et de langages
Profil recherché Profil

Diplômé d’une École d’Ingénieur ou équivalent, vous êtes très compétent techniquement et justifiez d’une solide expérience dans le développement, plus particulièrement en C# et HTML5 / CSS3. Idéalement, vous avez des connaissances dans les bases de données Oracle ou dans le développement SharePoint.

Vous êtes développeur Fullstack.

Vous avez des notions dans le domaine de la gestion de projet.

Les bonnes raisons de nous rejoindre :
Des missions diverses et un développement continu;

L’opportunité d’être très impliqué dans une expérience unique et multidisciplinaire ;

Une équipe expérimentée et de très haut niveau ;

Des clients et actionnaires majeurs dans le domaine de la propriété intellectuelle;

L’assurance d’une évolution professionnelle.
