Leader de la formation au digital et au management d’entreprise, ORSYS connait depuis plus de 40 ans une croissance ininterrompue qui nous positionne en tête de la profession en matière de créativité, de croissance et de rentabilité.
Cette réussite repose sur une stratégie d'innovation et de qualité jamais prise en défaut. A titre d'exemple, plus de 200 nouvelles formations sont créées chaque année : elles reposent sur les approches pédagogiques les plus innovantes.

Rejoignez-nous et accompagnez notre expansion !

Retrouvez notre univers sur Pinterest : https://www.pinterest.fr/orsysformation/coh%C3%A9sion-d%C3%A9quipe/
Description du poste
Rattaché(e) au service Étude et Développement, vos missions seront de :

Développer des applications répondant aux besoins des collaborateurs et des clients ;
Travailler sur les problématiques de tous nos départements (commercial, logistique, production, marketing, etc) et sur les services numériques offerts à nos clients ;
Être à l’affut des nouveautés technologiques dans votre domaine de compétences pour être force de proposition ;
Mener et suivre les projets de l’analyse jusqu’à la mise en place des campagnes de tests ;
Faire évoluer et maintenir nos applications ERP et CRM développées en .NET MVC sous SQL Server. Poursuivre la migration de ces applications anciennement développées sous VBA ;
Faire évoluer nos sites Web (www.orsys.fr, www.orsys-digital.fr) ;
Faire évoluer notre Intranet et nos applications Extranet ;
Participer à l’évolution des bases de données SQL Server de l’entreprise en termes de conception et de mise en œuvre ;
Administrer les tables de nos bases de données. Les exploiter : élaborer des requêtes et procédures en Transact-SQL pour faire, à partir d’applications .NET ou VBA, des mises à jour de données, extraire des statistiques et mettre en place des tableaux de bord et des rapports au moyen d’Excel et de SQL Server Reporting Services.

Vous travaillerez en équipe dans un de nos 6 étages de la Grande Arche avec des managers à l’écoute et dans une ambiance conviviale.

