Vous êtes un développeur .NET expérimenté, à la recherche d’un nouveau challenge dans une équipe internationale, vous voulez avoir un réel impact dans un groupe international et vous développer par la même occasion… alors nous sommes faits pour nous entendre !
Ce poste est basé à Paris avec des déplacements occasionnels dans nos bureaux d’Amsterdam et de Bergen (Norvège).
Votre mission :
En rejoignant notre équipe parisienne, vous contribuerez à l’innovation et au développement du Photo Organiser du groupe albelli. Vous interviendrez sur les micro services, le modèle de données graph, les APIs et ses interfaces. Votre objectif sera de rendre l’expérience client le plus agréable et le simple possible ; de l’upload des photos jusqu’à la création des produits. Vous ajouterez des fonctionnalités innovantes et vous maintiendrez l’existant.
Ah oui vous serez aussi responsable de plus de 800 millions d’images !
Vous rejoindrez une équipe Agile pluridisciplinaire localisée à Paris, Amsterdam et Bergen.

Vos principales responsabilités :
Designer, développer, tester et délivrer les nouvelles fonctionnalités du Photo Organiser ;
Proposer des améliorations dans notre façon de travailler en équipe ;
Partager vos compétences avec vos collègues au travers des sprint reviews, de séances de pair programming, des dev days etc ;
Vous aurez l’opportunité d’avoir un réel impact sur l’organisation de l’équipe, en travaillant notamment sur notre pipeline de test ;
Vous implémenterez les fonctionnalités décrites par nos Stakeholders mais vous apporterez également vos idées dans le backlog ;
Améliorer notre service de Storage ;
Améliorer notre infrastructure en ajoutant de nouveaux micro services ;
Migrer des micro services vers .NET Core ;
Tech keywords: .NET Core, C#, AWS, Serverless, Lambda, Micro Services, , Neo4J Graph Database, REST API
Profil :
Vous avez plus de 5 ans d’expérience en tant qu’ingénieur de développement ;
Un excellent niveau en C# et très bonne connaissance de la plateforme .NET ;
De solide expériences des technologies Web Microsoft (ASP.NET MVC or Web API);
Une très bonne expérience des tests unitaires et d’intégrations ;
Une expérience avec les bases relationnelles et un framework ORM ;
Vous avez un anglais courant à l'oral et à l’écrit.

Idéalement, vous avez une expérience sur des plateformes e-commerce en contact direct avec les clients ;
Connaissance des cloud providers, AWS idéalement ; connaissance de plusieurs autres langages ; Expérience de Continuous Delivery, TDD, BDD, DDD ; Expérience avec une base de données graph, idéalement Neo4J.

Nous offrons :

La liberté d’expérimenter les dernières technologies ;
Un contexte e-commerce à la pointe de la technologie sur des problématiques majeures en termes de charge, de stockage et de performances ;
Des bureaux Parisiens très agréables avec tous les avantages de WeWork ;
Une culture internationale et des bureaux à Amsterdam et Bergen ;
Une ambiance informelle, fun et détendue ;
Compensation compétitive, aide à la relocalisation et de nombreux autres avantages.

